script: |
  super -f text -I q9341.spq | sort > q9341.out

inputs:
  - name: q9341.spq
    data: |
      SELECT ALL + COUNT ( * ) + + 91 FROM tab1 (FORMAT parquet) WHERE col0 NOT BETWEEN + - col0 * - - ( ( ( - + 20 ) ) ) AND + + 34 + - - col0 * - 32;
  - name: tab1

outputs:
  - name: q9341.out
    data: |
      94
